import React, { Component } from "react";
import Navigation from "../components/Navigation";
import Projects from "../components/Projects";
import dataExp from "../data/dataExp";

class Knowledges extends Component {
  state = {
    languages: [
      { id: 2, techno: "HTML", xp: 0.98 },
      { id: 3, techno: "SCSS", xp: 1 },
      { id: 1, techno: "Javascript", xp: 2 },
      { id: 4, techno: "Bootstrap", xp: 2 },
      { id: 5, techno: "Reactjs", xp: 2 }
    ],
    Outils: [
      { id: 6, techno: "Illustrator", xp: 2 },
      { id: 7, techno: "Photoshop", xp: 0.2 },
      { id: 8, techno: "Git & Github", xp: 0.98 },
      { id: 9, techno: "Docker", xp: 1 },
      { id: 10, techno: "VS Code", xp: 1 }
    ],
    data: dataExp
  };
  render() {
    let { languages, Outils, data } = this.state;
    return (
      <>
        <Navigation />
        <div className="col-xl  ">
          <div className="w-50">
            <h1 className="profile display-4 fw-bolder">Knowledges</h1>
            <Projects
              languages={languages}
              title="Languages"
              className="fw-bolder mt-5"
            />
            <Projects
              languages={Outils}
              title="Outils"
              className="fw-bolder mt-5"
            />

            {data.map(experience => (
              <div className="w-50">
                <h1>{experience.profession}</h1>
                <em>{experience.profession}</em>
                <p>{experience.years}</p>
              </div>
            ))}
          </div>
        </div>
      </>
    );
  }
}

export default Knowledges;
